import React from 'react';
import './Projects.css';

const Projects = () => {
  return (
    <div className="projects-section">
      <h2>Projects</h2>
      <div className="project-card">
        <img 
          src=""
          alt=""
          className="card-img"
        />
        <h3>Project 1</h3>
        <p>
          Description of Project 1 Lorem ipsum dolor sit amet, consectetur adipiscing elit.
          Aenean dignissim neque vel est blandit, a dapibus dolor volutpat.
        </p>
        <a className="cardPage" href="/">GitHub Repository</a>
      </div>
      <div className="project-card">
        <h3>Project 2</h3>
        <p>
          Description of Project 2 Lorem ipsum dolor sit amet, consectetur adipiscing elit.
          Aenean dignissim neque vel est blandit, a dapibus dolor volutpat.
        </p>
        <a href="https://github.com/your-username/project2" target="_blank" rel="noopener noreferrer">GitHub Repository</a>
      </div>
      {/* Add more project cards as needed */}
    </div>
  );
};

export default Projects;
